import Link from "next/link";
import styled from "../styles/NavHeader.scss";
import global from "../styles/global.scss";

const NavHeader = () => (
  <div className={(global.m_container, styled.header)}>
    <div className="logo-container">
      <Link href="/">
        <a>
          <img src="../static/images/logo.svg" alt="SCALE LOGO" />
        </a>
      </Link>
    </div>
    <div className="mid-col">
      <ul>
        <li>About</li>
        <li>Blog</li>
        <li>Profit Calculator</li>
      </ul>
    </div>
    <div className="r-col">
      <ul>
        <li className="dark-btn">Sign Up</li>
        <li className="dark-btn">Log In</li>
      </ul>
    </div>
    <style jsx>{`
      .logo-container {
        display: flex;
        justify-content: center;
      }
      .logo-container img {
        width: 80px;
        height: 80px;
      }
      .mid-col ul {
        display: grid;
        grid-template-columns: repeat(3, 1fr);
      }
      .r-col ul {
        display: grid;
        grid-template-columns: repeat(2, 1fr);
      }
      dark-btn {
        display: flex;
        background: black;
        box-shadow: 5px 10px 10px rgba(0, 0, 0, 0.25);
        border-radius: 16px;
        padding: 10px 10px;
        style: none;
        color: white;
        justify-content: center;
        align-items: center;
        transition: 1.2s cubic-bezier(0.2, 0.8, 0.2, 1);
      }
    `}</style>
  </div>
);

export default NavHeader;
